import "./Catalog.css";

import ProductCard from "../ProductCard/ProductCard.js";

import printOvelhaNegra from "../../assets/visual_identity/prints/print_ovelha.png";
import printBesouro from "../../assets/visual_identity/prints/print_besouro.png";
import printFundoDoMar from "../../assets/visual_identity/prints/print_concha.png";
import printEspelho from "../../assets/visual_identity/prints/print_celular.png";
import printAbducao from "../../assets/visual_identity/prints/print_irmas.png";

function Catalog(props) {
    const products = [
        {
            id: 1,
            image: {printOvelhaNegra},
            name: "Print Ovelha Negra",
            price: "8,50",
            sizes: ["A5", "A4", "A3"]
        },
        {
            id: 2,
            image: {printBesouro},
            name: "Print Besouro",
            price: "8,50",
            sizes: ["A5", "A4", "A3"]
        },
        {
            id: 3,
            image: {printFundoDoMar},
            name: "Print Fundo do Mar",
            price: "8,50",
            sizes: ["A5", "A4", "A3"]
        },
        {
            id: 4,
            image: {printEspelho},
            name: "Print Espelho",
            price: "8,50",
            sizes: ["A5", "A4", "A3"]
        },
        {
            id: 5,
            image: {printAbducao},
            name: "Print Abdução",
            price: "8,50",
            sizes: ["A5", "A4", "A3"]
        }
    ];

    const { catalogType } = props;

    return (
        <article className={`allProductsCatalog ${catalogType}`}>
            {products.map((product, index) => (
                <ProductCard 
                    key={product.id}
                    image={product.image}
                    name={product.name}
                    price={product.price}
                    sizes={product.sizes}
                />
            ))}
        </article>
    );
}

export default Catalog;
